Juan a gyűjteményében lévő bélyegeket ország és az évtized szerint rendezi, amelyben kiadták őket. Az árak, amelyeket a bélyegboltban fizetett értük: Brazília és Franciaország, $6$ cent darabonként, Peru $4$ cent darabonként, és Spanyolország $5$ cent darabonként. (Brazília és Peru dél-amerikai országok, míg Franciaország és Spanyolország Európában találhatóak.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50s", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
label(scale(0.8)*"8", (7.5,2.5));
label(scale(0.8)*"6", (7.5,1.5));
label(scale(0.8)*"3", (7.5,0.5));

label(scale(0.8)*"60s", (10.5,4.5));
label(scale(0.8)*"7", (10.5,3.5));
label(scale(0.8)*"4", (10.5,2.5));
label(scale(0.8)*"4", (10.5,1.5));
label(scale(0.8)*"9", (10.5,0.5));

label(scale(0.8)*"70s", (13.5,4.5));
label(scale(0.8)*"12", (13.5,3.5));
label(scale(0.8)*"12", (13.5,2.5));
label(scale(0.8)*"6", (13.5,1.5));
label(scale(0.8)*"13", (13.5,0.5));

label(scale(0.8)*"80s", (16.5,4.5));
label(scale(0.8)*"8", (16.5,3.5));
label(scale(0.8)*"15", (16.5,2.5));
label(scale(0.8)*"10", (16.5,1.5));
label(scale(0.8)*"9", (16.5,0.5));

label(scale(0.8)*"Country", (3,4.5));
label(scale(0.8)*"Brazil", (3,3.5));
label(scale(0.8)*"France", (3,2.5));
label(scale(0.8)*"Peru", (3,1.5));
label(scale(0.8)*"Spain", (3,0.5));

label(scale(0.9)*"Juan's Stamp Collection", (9,0), S);
label(scale(0.9)*"Number of Stamps by Decade", (9,5), N);
[/asy] Mi volt a $70\text{'s}$ bélyegeinek átlagos ára centben? Kerekítsd a válaszodat a legközelebbi tizedes centhez.

original_question:
Az $ABC$ háromszög egyenlő szárú, ahol $AB=AC$ és az $AM$ magasság $11.$ Tegyük fel, hogy van egy $D$ pont $\overline{AM}$-en, ahol $AD=10$ és $\angle BDC=3\angle BAC.$ Határozd meg az $ABC$ háromszög kerületét.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

